import React from 'react'
import Navbar from './navbar';
import Product from './product';
import productimage from '../asset/pro image.webp'

const Home = () => {

    const product={
      name:"iphone 15",
      price:"150000",
      image:[{
        id:"sample_id",
        url:{productimage}
      }]
    }

  return(
    <>
        <div className="" style={{height:'100vh'}}> 
          <Navbar/>
          <div className='container d-flex justify-content-center mt-5 flex-flow-column'  >
                <h2 style={{borderBottom:"2px solid  gray ",padding:"5px",color:"red"}}>Features</h2><br/>
                <Product  product={product}/>
          </div>
          

           
          

        </div>
    </>

  )
   
}

export default Home;
